  JLUDBROOK, Edward Reginald and HEATH, Helen Whithell
  VLUDBROOK, Reginald Humphrey and WILSON, Jean Margaret
  JLUDBROOK, Diana Elizabeth and IRWIN, Jeremy Jon
  02> IRWIN, Mark Wilton Rex
  b 26.04.1965
  Mark b. at Lower Hutt. He is presently overseas. Address: C/- D Walden, 7 Shepherds Road, Taupo.
  01> LUDBROOK, Diana Elizabeth m on 05.12.1979 to (2)WALDIN, Warren Bridge
  b 12.12.1939
  b 03.11.1921
  Diana m. at Takapau. Warren, s/o William Norman Waldin and Eleanor Mary Bridge, b. at Waipukurau.
  Warren has six children from a previous marriage. Address: 7 Shepherds Road (PO Box 576), Taupo.
  Diana did secretarial work before marriage. Warren is a retired farmer.
  02> LUDBROOK, Antony Peter Rex m on 14.04.1966 to BUDDLE, Prudence Anne
  b 13.08.1941
  b 25.03.1946
  Antony b. at Hastings and m. at St Aidan's Church, Auckland. Prudence, d/o Thomas James Buddle and
  Beatrice Joan Barstow. Address: 48 Snapper Street, Hervey Bey, Qld, Australia.
  Antony was educated at Huntley School, Marton, Christ's College, Christchurch and Otago University
  (MBChB, 1966). He was elected MRACP (1971) and FRACP (1976). He was a consultant physician to the
  Dandenong and District Hospital, Dandenong Valley Private Hospital and South Eastern Private Hospital
  in Melbourne, Australia in 1977-94, and Clinical Dean at Dandenong Hospital Clinical School, Monash
  Medical School, Melbourne, Australia in 1992-94. He is now Director of Medicine and Director of
  Clinical Training at Hervey Bay and Maryborough Base Hospitals, Queensland, Australia.
  Prudence was educated at Nga Tawa School, Marton and graduated in physiotherapy from Otago University
  in 1966. She worked as a part-time secretary to Antony's private medical practice in Melbourne. She
  now enjoys playing tennis and golf and is keen on craft activities.
  01> LUDBROOK, Kirsty Anne
  b 09.01.1967
  Kirsty b. at Wellington and educated at Camberwell Church of England Girls' Grammar School,
  Melbourne, Australia. She is working as a technical assistant in the Department of Geology, BHP,
  Melbourne.
  02> LUDBROOK, Belinda Mary
  b 24.09.1968
  Belinda b, at Wellington and educated at Camberwell Church of England Girls' Grammar School,
  Melbourne. She worked as a model in Melbourne and is now studying naturopathy in Melbourne.
  03> LUDBROOK, Samuel Antony
  b 09.08.1972
  Samuel b. at Perth, Western Australia and educated at Camberwell Grammar School, Melbourne. He
  graduated in science from the University of Melbourne and is now working in the Research and
  Development Department of Dulux Paints in Melbourne.
  04> LUDBROOK, Thomas Antony
  b 19.10.1974
  Thomas b. at New Plymouth. He was a student at Camberwell Grammar School, Melbourne and has
  graduated in Computer Science from the Melbourne Institute of Technology.
